import React  from "react";
import { Link } from "react-router-dom";

export function NavMenuModule({temas}){
    return(
        <React.StrictMode>
            <ul>
                {
                    temas.map(type =>{
                        return(
                            <li>
                                <Link href={type.id.href}>{type.id.id}</Link>
                                <ul>
                                    {
                                        type.sub.temas.map(type =>{ 
                                            return <li><Link href={type.href}>{type.id}</Link></li>
                                        })
                                    }
                                </ul>
                            </li>
                        )
                    })
                }
            </ul>
        </React.StrictMode>
    )
}
